"use strict";(self.webpackChunkkywk_moco=self.webpackChunkkywk_moco||[]).push([[6146],{9780:function(t){t.exports=JSON.parse('{"blogPosts":[{"id":"/2022/05/24/gitlab-web-ide","metadata":{"permalink":"/moco/news/2022/05/24/gitlab-web-ide","source":"@site/news/2022/05-24-gitlab-web-ide.md","title":"The Future of the GitLab Web IDE","description":"2022.05.24 The Future of the GitLab Web IDE","date":"2022-05-24T00:00:00.000Z","formattedDate":"2022\u5e745\u670824\u65e5","tags":[{"label":"gitlab","permalink":"/moco/news/tags/gitlab"}],"readingTime":1.33,"truncated":true,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"The Future of the GitLab Web IDE","description":"2022.05.24 The Future of the GitLab Web IDE","authors":"kywk","tags":["gitlab"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":false},"nextItem":{"title":"Awesome Resources","permalink":"/moco/news/awesome"}},"content":"[GitLab \u767c\u8868\u65b0 WebIDE \u7684\u7279\u8272\u8207\u6574\u5408\u8aaa\u660e](https://about.gitlab.com/blog/2022/05/23/the-future-of-the-gitlab-web-ide/), \\n\u662f\u4ee5 VS Code \u6838\u5fc3\u5f15\u64ce [Monaco](https://microsoft.github.io/monaco-editor/)\\n\u958b\u767c\u6574\u5408\u800c\u4f86\u7684.\\n\\n\x3c!--truncate--\x3e\\n\\n> The Web IDE is built on top of the fantastic open source project, Monaco. \\n> What made Monaco a great choice as the foundation of the Web IDE \\n> is also what makes it more difficult to address all these concerns holistically. \\n> Monaco is just that: a foundation. We have to implement all these workflows \\n> and features ourselves. Meanwhile, another open source project has been \\n> laser-focused on delivering a lovable IDE on top of Monaco.\\n\\nVS Code \u78ba\u5be6\u662f Microsoft \u8fd1\u5e74\u4f86\u6700\u53d7\u6b61\u8fce\u80af\u5b9a\u7684\u7522\u54c1\u5c08\u6848. \\n\u4ee5 VS Code \u70ba\u57fa\u790e\u6574\u5408\u958b\u767c\u5176\u5be6\u5408\u7406. \u4f46\u56e0\u5fae\u8edf\u540c\u6642\u64c1\u6709 GitHub, \u6574\u4ef6\u4e8b\u8b8a\u5f97\u6709\u8da3.\\n\\n> It\'s interesting to me that GitLab is adopting a Microsoft product \\n> (VS Code) and Microsoft owns a significant competitor in GitHub. \\n> Nothing intelligent to say about that other than to wish \\n> I\'d been a fly on the wall for the discussions about that.\\n\\n[Hacker News](https://news.ycombinator.com/item?id=31487079)\\n\u4e0a\u8a31\u591a\u8a0e\u8ad6\u70ba\u4f55 GitHub \u8eab\u70ba GitLab \u6700\u5927\u7684\u5c0d\u624b, GitLab \u537b\u9078\u7528\u4e86\u5c0d\u624b\u6bcd\u516c\u53f8\u7684\u5c08\u6848\u4f5c\u70ba\u6838\u5fc3\u529f\u80fd.\\n\u9806\u4fbf\u628a\u66fe\u7d93\u88ab GitHub \u865f\u7a31\u7684 21 \u4e16\u7d00 IDE - [Atom](https://github.com/atom/atom) \u6293\u51fa\u4f86\u97ad\u5c4d\u4e00\u4e0b."},{"id":"/awesome","metadata":{"permalink":"/moco/news/awesome","source":"@site/news/awesome.md","title":"Awesome Resources","description":"This is News Clippins","date":"2022-05-20T00:00:00.000Z","formattedDate":"2022\u5e745\u670820\u65e5","tags":[{"label":"awesome","permalink":"/moco/news/tags/awesome"}],"readingTime":0.095,"truncated":true,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"Awesome Resources","description":"This is News Clippins","date":"2022-05-20T00:00:00.000Z","authors":"kywk","tags":["awesome"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":false},"prevItem":{"title":"The Future of the GitLab Web IDE","permalink":"/moco/news/2022/05/24/gitlab-web-ide"}},"content":"\x3c!--truncate--\x3e\\n\\n## news & discus ##\\n\\n-   [Hacker News](https://news.ycombinator.com/)\\n-   [DEV Community \ud83d\udc69\u200d\ud83d\udcbb\ud83d\udc68\u200d\ud83d\udcbb](https://dev.to/)\\n-   [IT\u4eba](https://iter01.com/)\\n-   [MdEditor](https://www.gushiciku.cn/pl/)"}]}')}}]);